import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBell } from '@fortawesome/free-solid-svg-icons';

class Notifications extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            // <div className="icon-container"> 
            //     <div className="icon-counter">112</div>
            //     <i class="fas fa-bell" style={{ "font-size": "1vw"}}/>
            // </div>
            <span class="fa-layers fa-fw">
                <FontAwesomeIcon icon={faBell} style={{ "font-size": "1.4vw", "margin-top": "20%"}}/>
                <span class="fa-layers-counter" style={{ "background": "Tomato", "font-size": "3vw"}}>3</span>
            </span>
        );
    }
}

export default Notifications;
